  console.log(cart);

  return(
    <Table>
      <thead>
        <tr>
          <th>#</th>
          <th>상품명</th>
          <th>수량</th>
          <th>변경하기</th>
        </tr>
      </thead>
      {
        cart.map((element)=>{
          return (
            <tbody>
              <tr>
                <td>1</td>
                <td>안녕</td>
                <td>안녕</td>
                <td>안녕</td>
              </tr>
            </tbody>
          )
        })
      }
    </Table> 
  );
}
